      .then((res) => {
        setfueldata(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  function deletee(id) {
    axios
      .delete(`${url}/api/fuel_sort/${id}/`, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
